import React from 'react';
import DataEntry from './DataEntry';

export const DataHeader = (props) => {
  const { dataEntries } = props;
  console.log(props)
  if (dataEntries !== undefined) {
    return (
      <div className="striped highlight centered white">
        <table>
          <thead>
            <tr>
              <th>Actual MAC Address</th>
              <th>Spoofed MAC</th>
              <th>AP Name</th>
              <th>AP BSSID</th>
              <th>Gateway Address</th>
              <th>Google Avg Ping/ms</th>
              <th>Google DNS Avg Ping/ms</th>
              <th>Gateway Avg Ping/ms</th>
              <th>HTTP Response</th>
              <th>RSSI/dBm</th>
              <th>Signal Strenght/%</th>
              <th>Frequency/Hz</th>
              <th>Authentication Time/s</th>
              <th>Test date and time</th>
            </tr>
          </thead>
          <tbody>
          { dataEntries && dataEntries.map((entry, index) => {
            return (<DataEntry dataEntry={entry} key={index}></DataEntry>)
          }) }
          </tbody>
        </table>
      </div>
    )
  } else {
    return (
      <div>
        <p> No Data to show </p>
      </div>
    )
  }
}
